:root {
  --petrol: 47, 141, 133;
  --grey: 235, 232, 229;
  --beige: 250, 243, 236;
  --blue: 209, 243, 247;
  --orange: 248, 143, 6;
  --denim: 54, 65, 88;
  --black: 0, 0, 0;
  --white: 255, 255, 255;
  --primary: var(--orange);
  --secondary: var(--blue);
  --success: 0, 255, 0;
  --info: var(--denim);
  --btn-bg: rgb(var(--petrol), 1);
  --btn-color: rgb(var(--white), 1);
  --btn-padding: 0.5rem 0.5rem 0.5rem 0.5rem;
  --btn-radius: 10px;
  --fs-xs: 10px;
  --fs-md: 18px;
  --fs-lg: 36px;
  --fs-xl: 64px;
  --fw-xs: 200;
  --fw-sm: 300;
  --fw-md: 400;
  --fw-lg: 600;
  --fw-xl: 800;
  --rad-xs: 4px;
  --rad-md: 8px;
  --rad-lg: 16px;
  --rad-xl: 32px;
  --shad-md: 0px 10px 15px -3px rgb(var(--beige), 0.1),
    0px 10px 15px -3px rgb(var(--beige), 0.1);
  --body-bg-gradient: linear-gradient(
    to bottom,
    rgb(var(--petrol), 1) 0%,
    rgb(var(--petrol), 1) 15%,
    rgb(var(--blue), 1) 50%,
    rgb(var(--petrol), 1) 100%
  );
  --body-bg: rgb(var(--petrol), 1);
  --body-color: rgb(var(--beige));
  --body-fs: var(--fs-md);
  --padd-xs: 0.25rem;
  --padd-md: 0.5rem;
  --padd-lg: 1rem;
  --padd-xl: 4rem;
  --content-width: 1100px;
  --content-padding: var(--padd-lg);
  --break-xs: 280px;
  --break-sm: 320px;
  --break-sm: 360px;
  --break-md: 567px;
  --break-lg: 768px;
  --break-xl: 1024px;
  --break-xxl: 1400px;
}
:root .primary {
  color: rgb(var(--primary));
}

html {
  scroll-behavior: smooth;
}

body {
  min-height: 100vh;
  overflow-x: hidden;
}

/* Layout */
article {
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: [header] auto [main] 1fr [footer] auto;
  min-height: 100vh;
}

/* helper classes for html */
.placeitemscenter {
  display: grid;
  place-items: center;
}

.indent-me {
  box-sizing: border-box;
  max-width: var(--content-width);
  padding: var(--content-padding);
  margin: 0 auto;
  width: 100%;
}

/* froala editor css */
.fr-img-caption {
  background: var --white;
  border-radius: var(--rad-xs);
  display: block;
  margin: 0 0 20px 0;
  padding: 0 0 5px 0;
  position: relative;
  top: 17px !important;
}
.fr-img-caption img {
  width: 100% !important;
  border-radius: 4px 4px 0 0;
}

.fr-inner {
  display: block;
  font-size: 12px;
  padding: 10px 10px 5px 10px;
  margin: 0;
}

.fr-fic {
  border-radius: 4px;
  max-width: 100% !important;
}

.fr-fil {
  float: left;
  margin: 0 20px 10px 0;
  position: relative;
  top: 5px;
}

.fr-fir {
  float: right;
  margin: 0 0 10px 20px;
  position: relative;
  top: 5px;
}

p a:hover {
  text-decoration: underline !important;
}

li a, li a:hover, li li:hover a {
  text-decoration: none;
}

a.imglink:hover {
  background-color: var(--primary);
  display: block;
  border-radius: 8px;
}

a.imglink:hover > img, a.imglink:hover > picture {
  filter: opacity(80%);
}

.btn {
  display: inline-block;
  padding: var(--btn-padding);
  border-radius: var(--btn-radius);
  color: var(--btn-color);
  position: relative;
  text-decoration: none;
  transition: all 0.3s;
  overflow: hidden;
  z-index: 1;
}
.btn:after {
  content: "";
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: var(--btn-bg);
  border-radius: var(--btn-radius);
  z-index: -2;
}
.btn:before {
  content: "";
  position: absolute;
  bottom: 0;
  left: 0;
  width: 0%;
  height: 100%;
  background-color: rgb(var(--white), 0.25);
  transition: all 0.3s;
  border-radius: var(--btn-radius);
  z-index: -1;
}
.btn:hover {
  color: var(--btn-color);
}
.btn:hover:before {
  width: 100%;
}

#contactbox {
  background: var(--primary);
  color: var(--white);
  position: fixed;
  bottom: 1rem;
  right: 1rem;
  text-align: center;
}
#contactbox a {
  color: var(--white);
  text-decoration: none !important;
}
#contactbox a:hover, #contactbox a:focus, #contactbox a:active {
  text-decoration: underline !important;
}
#contactbox div#links {
  font-size: var(--fs-xs) !important;
}
#contactbox div#booking {
  background: rgb(var(--white), 0.5);
  border: 0px solid var(--white);
  border-radius: 4px;
  font-size: var(--fs-xs) !important;
  margin: 0.4rem auto 0.5rem auto;
  padding: 0 0 0 0;
  width: 90%;
}

#faq {
  background: yellow;
  width: 100%;
}
#faq details {
  border-top: 1px solid #ccc;
  padding: 1rem 0 1rem 0;
}
#faq details:last-child {
  border-bottom: 1px solid #ccc;
}
#faq details[open] {
  padding-bottom: 0;
}
#faq summary {
  padding: 0 1rem 0 1rem;
  margin: 0;
  cursor: pointer;
  border-radius: 5px;
}
#faq summary::-webkit-details-marker,
#faq summary::marker {
  display: none !important;
  content: "";
  /* fix for chrome */
}
#faq summary:after {
  content: "";
  width: 10px;
  height: 10px;
  transform: rotate(45deg);
  transition: all 0.5s ease-out;
  border-bottom: 1px solid black;
  border-right: 1px solid black;
  float: right;
}
#faq details[open] div {
  animation: blend-in 0.5s ease-out;
  background: linear-gradient(to bottom, #fff 0%, #eee 100%);
  margin: 1rem 0 0 0;
  padding: 0 1rem 0.5rem 1rem;
}
@keyframes blend-in {
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}
#faq details[open] summary:after {
  content: "";
  transform: rotate(-135deg);
  margin-top: 8px;
}
#faq details[open] summary:after {
  content: "";
  transform: rotate(-135deg);
  margin-top: 8px;
}
#faq summary > h4 {
  display: inline;
  font-size: 20px;
  font-weight: 400;
}
#faq details[open] summary > h3 {
  font-weight: 800;
}

footer {
  background: rgb(var(--beige));
  display: grid;
  grid-template-rows: 500px;
}
footer section {
  border: 2px solid orange;
  display: grid;
  grid-template-columns: 1fr;
  margin: 0 auto;
  max-width: var(--content-width);
  width: 100%;
}
footer section div {
  border: 1px solid red;
}

@media only screen and (min-width: 576px) {
  footer section {
    grid-template-columns: repeat(2, 1fr);
  }
  footer section div:nth-child(3) {
    grid-column: 1/4;
    padding: 0 3rem 0 3rem;
  }
}
@media only screen and (min-width: 768px) {
  footer section {
    grid-template-columns: repeat(3, 1fr);
  }
  footer section div:nth-child(3) {
    grid-column: 3/4;
    padding: 0;
  }
}
