.gallery {
  /*
  	100% Height for Opera as the max-height seems to be ignored, not optimal for large screens
  	http://bricss.net/post/11230266445/css-hack-to-target-opera
  */
}
.gallery .lb-album {
  list-style: none;
  padding-bottom: 2rem;
  padding: 0 !important;
  display: inline-block;
}
.gallery .lb-album li {
  float: left;
  margin: 10px 10px 0 0;
}
.gallery .lb-album li > a,
.gallery .lb-album li > a img {
  display: block;
}
.gallery .lb-album li > a {
  width: 200px;
  height: 150px;
}
.gallery .lb-overlay {
  background: rgb(var(--blue), 1);
  display: none !important;
  height: 0px;
  overflow: hidden;
  padding: 0 0 0 0;
  position: fixed;
  left: 0px;
  top: 0;
  text-align: center;
  width: 0px;
  z-index: 999999;
}
.gallery .lb-overlay .controls {
  margin: 0 0 0 -250px;
  opacity: 0;
  position: absolute;
  left: 50%;
  top: 25px;
  width: 500px;
  z-index: 1001;
}
.gallery .lb-overlay .controls .svg-inline--fa {
  color: rgb(var(--black), 1);
  height: 50px;
  width: 50px;
}
.gallery .lb-overlay img {
  box-shadow: 0px 2px 7px rgba(255, 255, 255, 0.2);
  height: auto;
  max-height: 70vh;
  position: relative;
  top: 0;
  width: auto;
  max-width: 90vw;
}
.gallery .lb-overlay .info {
  color: rgb(var(--black), 1);
  margin: 10px auto 0 auto;
  max-width: 1000px;
  opacity: 0;
  position: relative;
  top: 0;
  text-shadow: 0px 1px 1px rgba(255, 255, 255, 0.6);
  transition: opacity 1s linear 1.2s;
}
.gallery .lb-overlay .info h3 {
  display: inline-block;
  border-right: 1px solid rgb(var(--black));
  padding: 0.75rem 1rem 0.75rem 0 !important;
}
.gallery .lb-overlay .info p {
  display: inline-block;
  padding: 0 0 0 1rem;
}
.gallery .lb-overlay:target {
  display: block !important;
  width: auto;
  height: auto;
  bottom: 0px;
  right: 0px;
  padding: 80px 0.25rem 120px 0.25rem;
}
.gallery .lb-overlay:target img {
  animation: fadeInScale 1.2s ease-in-out;
}
.gallery .lb-overlay:target .controls,
.gallery .lb-overlay:target .info {
  opacity: 1;
}
@-webkit-keyframes fadeInScale {
  0% {
    -webkit-transform: scale(0.6);
    opacity: 0;
  }
  100% {
    -webkit-transform: scale(1);
    opacity: 1;
  }
}
@-moz-keyframes fadeInScale {
