sources.partials/buttons.scss:
.btn {
    display: inline-block;
    padding: var(--btn-padding);
    border-radius: var(--btn-radius);
    color: var(--btn-color);
    position: relative;
    text-decoration: none;
    transition: all .3s;
    overflow: hidden;
    z-index: 1;
    &:after {
      content: '';
      position: absolute;
      bottom: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-color:  var(--btn-bg);
      border-radius: var(--btn-radius);
      z-index: -2;
    }
    &:before {
      content: '';
      position: absolute;
      bottom: 0;
      left: 0;
      width: 0%;
      height: 100%;
      background-color: rgb(var(--white), .25 );
      transition: all .3s;
      border-radius: var(--btn-radius);
      z-index: -1;
    }
    &:hover {
      color: var(--btn-color);
      &:before {
        width: 100%;
      }
    }
  }

